INSERT INTO `wp_posts` VALUES (1,1,'2017-11-19 03:52:51','2017-11-19 03:52:51','Bienvenido a WordPress. Esta es tu primera entrada. Edítala o bórrala, ¡y comienza a escribir!','¡Hola mundo!','','publish','open','open','','hola-mundo','','','2017-11-19 03:52:51','2017-11-19 03:52:51','',0,'http://127.0.0.1/MyAppDroid2/?p=1',0,'post','',1),(2,1,'2017-11-19 03:52:51','2017-11-19 03:52:51','Esta es una página de ejemplo, Es diferente a una entrada de un blog porque se mantiene estática y se mostrará en la barra de navegación (en la mayoría de temas). Casi todo el mundo comienza con una página Sobre mí para presentarse a los potenciales visitantes. Podría ser algo así:\n\n<blockquote>¡Hola!: Soy mensajero por el día, aspirante a actor por la noche y esta es mi web. Vivo en Madrid, tengo perrazo llamado Juan y me encantan las piñas coladas (y que me pille un chaparrón)</blockquote>\n\n… o algo así:\n\n<blockquote>La empresa Calcetines XYZ se fundó en 1971, y ha estado produciendo calcetines de calidad para sus clientes desde entonces. Ubicada en Gothan, la empresa XYZ tiene más de 2.000 empleados e intenta ayudar en lo que puede para mejorar la vida en Gothan</blockquote>\n\nSi eres nuevo en WordPress deberías ir a <a href=\"http://127.0.0.1/MyAppDroid2/wp-admin/\">tu escritorio</a> para borrar esta página y crear algunas nuevas con tu contenido. ¡Pásalo bien!','Página de ejemplo','','publish','closed','open','','pagina-ejemplo','','','2017-11-19 03:52:51','2017-11-19 03:52:51','',0,'http://127.0.0.1/MyAppDroid2/?page_id=2',0,'page','',0),(3,1,'2017-11-19 03:53:42','0000-00-00 00:00:00','','Borrador automático','','auto-draft','open','open','','','','','2017-11-19 03:53:42','0000-00-00 00:00:00','',0,'http://127.0.0.1/MyAppDroid2/?p=3',0,'post','',0),(4,1,'2017-11-19 04:05:22','2017-11-19 04:05:22','','Tienda','','publish','closed','closed','','tienda','','','2017-11-19 04:05:22','2017-11-19 04:05:22','',0,'http://127.0.0.1/MyAppDroid2/?page_id=4',0,'page','',0),(5,1,'201